const initState = {
    locationList: ['Mumbai','Delhi','Aurangbad','Banglore','Chennai','Hyderabad'],
    selectedLocation : 'Delhi'
}

export function RootReducer(state = initState, action) 
{
    if (action.type === "UPDATE_CITY") 
    {
        console.log(action.selectedLocation," mil gaya !!!!!!");
        const newState = 
        {
            ...state,
            selectedLocation : action.selectedLocation
        };
        return newState;
    }
    return state;
}
